export type AuthRequest = {
  email: string;
  password: string;
};

export type User={
  firstname: string;
  lastname: string;
  email: string;
  password: string;
  address: string;
  governmentIdentityId: string;
  profilePicture:string
}

export type RequestPost = {
  type: Type;
  latitude: number;
  longitude: number;
  description: string;
};

export type RequestGet = {
  type: Type;
  latitude: number;
  longitude: number;
  description: string;
  status: Status;
  requester:User
};

export type ChatMessage={
  userId:string,
  recipientId:string,
  content:string,
  connected:boolean,
  MessageType:MessageType
}

export enum Type {
  OneTimeTask = 'One-time task',
  MaterialNeed = 'Material need'
}

export enum Status {
  Fulfilled = 'Fulfilled',
  Unfulfilled = 'Unfulfilled'
}

enum MessageType{
  CHAT='CHAT',
  JOIN='JOIN',
  LEAVE='LEAVE'
}
